@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM rdf:type owl:Class .
atm:BankComputer rdf:type owl:Class .
atm:Card rdf:type owl:Class .
atm:BankCode rdf:type owl:Class .

atm:requestsVerification rdf:type owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Card .

atm:checks rdf:type owl:ObjectProperty ;
    rdfs:domain atm:BankComputer ;
    rdfs:range atm:BankCode .

atm:hasCard rdf:type owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Card .

atm:hasBankCode rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Card ;
    rdfs:range atm:BankCode .

atm:valid rdf:type owl:DatatypeProperty ;
    rdfs:domain atm:BankCode ;
    rdfs:range rdf:XMLLiteral .

[ rdf:type owl:Axiom ;
  owl:propertyChainAxiom ( atm:requestsVerification atm:hasBankCode ) ;
  owl:equivalentProperty atm:checks ] .
